<template>
	<view>
		<uni-section title="图文教程" type="line">
			<uni-collapse ref="collapse" v-model="value" @change="change">
				<uni-collapse-item title="理财计算器" :open="true">
					<view class="content">
						<view>第一步：【利率%】，输入题目中的利率，不要输入百分号，例如7%，只需要输入数字7即可;</view>
						<view class="image-content">
							<image @click="previewImage(0)" class="image-view" mode="widthFix" :src="src[0]" @error="imageError"></image>
						</view>
						<view>第二步：【期数】，输入数字时，需要先点击前面，出现“对勾”即为选中，才可输入数字;</view>
						<view class="image-content">
							<image @click="previewImage(1)" class="image-view" mode="widthFix" :src="src[1]" @error="imageError"></image>
						</view>
						<view>第三步：【现值】，操作同上;</view>
						<view class="image-content">
							<image @click="previewImage(2)" class="image-view" mode="widthFix" :src="src[2]" @error="imageError"></image>
						</view>
						<view>第四步：【终值】，操作同上;</view>
						<view class="image-content">
							<image @click="previewImage(3)" class="image-view" mode="widthFix" :src="src[3]" @error="imageError"></image>
						</view>
						<view>第五步：需要求的参数，不需要点击前面，不需要出现“对勾”;</view>
						<view class="image-content">
							<image @click="previewImage(4)" class="image-view" mode="widthFix" :src="src[4]" @error="imageError"></image>
						</view>
						<view>第六步：【期初】【期末】，根据情况选择即可。但是在没有特别说明的情况下，默认选择【期末】即可。</view>
						<view class="image-content">
							<image @click="previewImage(5)" class="image-view" mode="widthFix" :src="src[5]" @error="imageError"></image>
						</view>
						<view>第七步：点击计算或清空按钮显示或清除计算结果，-号表示资金流入方向。</view>
						<view class="image-content">
							<image @click="previewImage(6)" class="image-view" mode="widthFix" :src="src[6]" @error="imageError"></image>
						</view>
					</view>
				</uni-collapse-item>
			</uni-collapse>
		</uni-section>
	</view>
</template>

<script>
	export default {
		data() {
			return {
				src: [
					'data:image/png;base64,',
					'data:image/png;base64,',
					'data:image/png;base64,',
					'data:image/png;base64,',
					'data:image/png;base64,',
					'data:image/png;base64,',
					'data:image/png;base64,',
				],
				value: ['1'],
			};
		},
		methods: {
			imageError: function(e) {
				console.error('image发生error事件，携带值为' + e.detail.errMsg)
			},
			change(e) {
				console.log(e);
			},
			previewImage(index) {
				// 预览功能需要数组格式，具体查看uniapp文档：previewImage
				// const seeImgList = []
				// seeImgList[0] = this.src[index]
				uni.previewImage({
					current: index, //预览图片的下标
					urls: this.src //预览图片的地址，必须要数组形式，如果不是数组形式就转换成数组形式就可以
				})
			},
		}
	}
</script>

<style lang="scss">
	.content {
		padding: 15px;
		font-size: 14px;
	}

	.image-content {
		margin-top: 1%;
	}

	.image-view {}
</style>